import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import './Header.css'
export function Header() {
  return (
    <>
      <Navbar bg="dark" data-bs-theme="dark">
        <Container>

          <Navbar.Brand to="/home"><img src='/Images/e-Mart-logos_white.png' /></Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="/Home">Home</Nav.Link>
            <Nav.Link href="/Contactus">Contact us</Nav.Link>
          </Nav>
          <Nav className="me-auto right">
            <Nav.Link href="/Login">Login User</Nav.Link>
            <Nav.Link href="/RegisterPage">Register User</Nav.Link>
            <Nav.Link href="/addCart">AddCart</Nav.Link>
          </Nav>
        </Container>
      </Navbar>

    </>
  );
}
